package com.limechain.trie.structure;

import com.limechain.trie.structure.nibble.BytesToNibbles;
import com.limechain.trie.structure.nibble.Nibble;
import com.limechain.trie.structure.nibble.Nibbles;
import com.limechain.trie.structure.nibble.NibblesCollector;
import org.junit.jupiter.api.RepeatedTest;
import org.junit.jupiter.api.Test;

import java.util.ArrayList;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;
import java.util.Set;
import java.util.TreeSet;
import java.util.concurrent.ThreadLocalRandom;
import java.util.stream.Collectors;
import java.util.stream.Stream;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertInstanceOf;
import static org.junit.jupiter.api.Assertions.assertTrue;

class TrieStructureTest {
    private static <T> void insert(TrieStructure<T> trie, Nibbles key) {
        switch (trie.node(key)) {
            case Vacant<T> vacant -> {
                vacant.prepareInsert().insert(null);
            }
            case BranchNodeHandle<T> branchNodeHandle -> {
                branchNodeHandle.convertToStorageNode();
            }
            case StorageNodeHandle<T> __ -> {}
        }
    }

    @Test
    void structurallyEqualsBasicTest() {
        var trie1 = new TrieStructure<Integer>();
        var trie2 = new TrieStructure<String>();

        assertTrue(trie1.structurallyEquals(trie2),
            "Empty tries must be structurally equal.");

        final Nibbles key = new Nibbles(new BytesToNibbles("foo".getBytes()));
        trie1
            .node(key)
            .asVacant()
            .prepareInsert()
            .insert(123);

        assertFalse(trie1.structurallyEquals(trie2),
            "Trie with one node must not be structurally equal to an empty trie.");

        trie2
            .node(key)
            .asVacant()
            .prepareInsert()
            .insert("something");

        assertTrue(trie1.structurallyEquals(trie2),
            "Two tries with a single node must be structurally equal.");
    }

    @Test
    void insertionBetweenShortAndLongKey() {
        var shortKey = "1";
        var midKey = "123";
        var longKey = "12345";

        var keys = Stream.of(shortKey, longKey, midKey)
            .map(Nibbles::fromHexString)
            .toList();

        var trie = new TrieStructure<>();

        for (var key : keys) {
            trie.node(key)
                .asVacant()
                .prepareInsert()
                .insert(null);
        }

        assertEquals(3, trie.nodes.size(),
            "Exactly three nodes expected.");
        assertTrue(trie.nodes.getAllEntries().stream().allMatch(p -> p.getValue1().hasStorageValue),
            "All three nodes must have storage values");

        var expectedPartialKeysInOrder =
            Stream.of(1, 3, 5)
                .map(Nibble::fromInt)
                // NOTE: Intentionally lists of only one nibble, since those are the expected partial keys
                .map(Nibbles::new)
                .toList();

        int i = 0;
        for (TrieNodeIndex nodeIndex : trie.asIterableOrdered()) {
            assertEquals(
                expectedPartialKeysInOrder.get(i++),
                trie.getNodeAtIndexInner(nodeIndex.getValue()).partialKey
            );
        }
    }

    @Test
    void insertionOrderDoesntMatterWhenInsertingInBetweenNodesTest() {
        var shortKey = List.of(1);
        var midKey = List.of(1, 2, 3);
        var longKey = List.of(1, 2, 3, 4, 5);

        var keysPermutations = List.of(
            List.of(shortKey, longKey, midKey),
            List.of(midKey, longKey, shortKey),
            List.of(longKey, midKey, shortKey)
        );

        List<TrieStructure<Object>> tries = new ArrayList<>();
        for (var keys : keysPermutations) {
            var trie = new TrieStructure<>();

            for (var key : keys) {
                var k = new Nibbles(key.stream().map(Nibble::fromInt));
                var handle = trie.node(k);

                handle
                    .asVacant()
                    .prepareInsert()
                    .insert(null);
            }

            tries.add(trie);
        }

        for (var first : tries) {
            for (var second : tries) {
                assertTrue(first.structurallyEquals(second), "Insertion order should not matter.");
            }
        }
    }

    @Test
    void insertionAccuratelyCreatesBranchNodesWithoutStorageValue() {
        var trie = new TrieStructure<>();
        var keys = Stream.of(
                "1",
                "12345",
                "12356"
            )
            .map(Nibbles::fromHexString)
            .toList();

        for (var key : keys) {
            trie.node(key)
                .asVacant()
                .prepareInsert()
                .insert(null);
        }

        assertFalse(trie.node(Nibbles.of(1, 2, 3)).asNodeHandle().hasStorageValue());
    }

    // NOTE: This is illegally beautiful :D
    /**
     * <img src="data:image/png;base64,"/>
     */
    @Test
    void insertNoCommonPrefixBasic() {
        var trie = new TrieStructure<>();

        Stream.of(
                "12",
                "34"
            ).map(Nibbles::fromHexString)
            .forEach(key -> {
                insert(trie, key);
            });

        assertEquals(3, trie.nodes.size());
        assertInstanceOf(BranchNodeHandle.class, trie.node(Nibbles.EMPTY));
        assertInstanceOf(StorageNodeHandle.class, trie.node(Nibbles.fromHexString("12")));
        assertInstanceOf(StorageNodeHandle.class, trie.node(Nibbles.fromHexString("34")));
    }

    // NOTE: Very essential random test
    @RepeatedTest(100)
    void orderedIterationWorksProperly() {
        // How many storage keys we want to insert
        int numberOfStorageKeys = ThreadLocalRandom.current().nextInt(0, 100);

        // Instantiate the trie we'll be inserting to
        TrieStructure<Object> trie = new TrieStructure<>(numberOfStorageKeys);

        // Prepare some data structures for the expected values of the assertions
        TreeSet<Nibbles> expectedSortedStorageKeys = new TreeSet<>();
        List<Nibbles> actualKeysInOrderOfInsertion = new ArrayList<>(numberOfStorageKeys);

        for (int i = 0; i < numberOfStorageKeys; ++i) {
            // Generate the storage key
            int keyLen = ThreadLocalRandom.current().nextInt(0, 15);

            Nibbles key = Stream.generate(() -> ThreadLocalRandom.current().nextInt(0, 16))
                .map(Nibble::fromInt)
                .limit(keyLen)
                .collect(NibblesCollector.toNibbles());

            // Add to the lexicographically ordered TreeSet of storage keys
            expectedSortedStorageKeys.add(key);
            // Add to the actual queue of storage keys (to preserve insertion order for easier debugging)
            actualKeysInOrderOfInsertion.add(key);

            // Perform the actual insertion of the storage key into the trie
            switch (trie.node(key)) {
                case Vacant<Object> vacant -> {
                    vacant.prepareInsert().insert(null);
                }
                case BranchNodeHandle<Object> branchNodeHandle -> {
                    branchNodeHandle.convertToStorageNode();
                }
                case StorageNodeHandle<Object> __ -> {}
            }
        }

        assertEquals(trie.nodes.size(), trie.streamOrdered().count(),
            "Ordered iterator count mismatch. Expected to account for every node.");

        List<Nibbles> actualSortedKeys = trie
            .streamOrdered() // get all TrieNodeIndices, but lexicographically ordered by full key (hex path) to the node
            .map(trie::nodeFullKeyAtIndex) // get the actual full keys
            .toList();

        // Assert the keys were already sorted
        assertEquals(
            actualSortedKeys.stream().sorted().toList(),
            actualSortedKeys,
            "Full keys of all nodes are expected to be sorted when iterating in order.");

        // And most importantly, assert we can traverse the storage keys only, also ordered
        var actualSortedStorageKeys = actualSortedKeys
            .stream()
            .filter(fullKey ->
                trie.node(fullKey)
                    .asNodeHandle()
                    .hasStorageValue()
            );

        assertEquals(
            expectedSortedStorageKeys.stream().toList(),
            actualSortedStorageKeys.toList(),
            String.format(
                "Ordered iteration of the trie structure must iterate all storage keys in lexicographic order.%n" +
                "Actual insertion order of storage keys: %s", actualKeysInOrderOfInsertion
            )
        );
    }

    @Test
    void emptyTrieHasNoElementsToIterate() {
        var trie = new TrieStructure<>();
        assertEquals(0, trie.allNodesInLexicographicOrder().count());
    }
}